Her magical new album, Sentir, is her most mesmerising accomplishment so far, and will surely find a place on many a record of the year list in the coming months. --Sunday Times 

Each of her albums has its unique character. This new one is her most interesting yet, benefiting from a wide range of influences brought in through her accompanying ensemble. --Scotsman

